import { Fragment } from 'react'
import { useHistory } from "react-router-dom";

const Experience = () => {
  const history = useHistory()

  const handleChooseExperience = (e) => {
    const experienceType = e.target.id
    history.push(`experience/${experienceType}`)
  }

  return (
    <Fragment>
      <div className="flex flex-col justify-center">
        <h1 className="font-montserrat-bold text-16">Souhaitez vous une expérience...</h1>
        <button onClick={(e) => handleChooseExperience(e)} id='inside'>
          <p className="font-montserrat-bold text-21">À l'intérieur</p>
        </button>
        <button onClick={(e) => handleChooseExperience(e)} id='outdoor'>
          <p className="font-montserrat-bold text-21">À l'extérieur</p>
        </button>
      </div>
    </Fragment>
  )
}

export default Experience
